import React from "react";
import { Photo } from "../../svg";

const AddToYourPost = () => {
  return (
    <div className="addtoyourpost">
      <div className="addto_text">Add to your post</div>
      <div className="post_header_right hover1">
        <Photo />
      </div>
    </div>
  );
};

export default AddToYourPost;
